import styles from '../Styles/styles.css'

function Register() {
    return (
        <div>
            <h1>This is Register</h1>
            <form>
                <label>First Name:<input type="text" name="name" /></label>
                <label>Last Name:<input type="text" name="name" /></label>
                <label>Phone Number:<input type="text" name="name" /></label>
                <label>Email:<input type="text" name="name" /></label>
                <label>Password:<input type="text" name="name" /></label>
                <label>Re-Password:<input type="text" name="name" /></label>
                <input type="checkbox"
                    checked={checked}
                    onChange={() => setChecked(!checked)}
                />
                <input type="submit" value="Submit" />
            </form>
        </div>
    );
}

export default Register;
